import React, { Component } from "react";
import Project from "../components/Project";
import bricklayer_home from "../webexamples/bricklayer_home.pdf";
import bricklayer_build from "../webexamples/bricklayer_build.pdf";
import poems from "../webexamples/poems.pdf";
import quarantine_cuisine from "../webexamples/quarantine_cuisine_expand.pdf";

export default class Webdev extends Component {
  render() {
    return (
      <>
        <h1>Projects</h1>
        <Project image1={bricklayer_home} image2={bricklayer_build} />
        <Project image1={poems} />
        <Project image1={quarantine_cuisine} />
      </>
    );
  }
}
